import { changeQuantidade } from "../Actions";
import { saveOrcamento } from "../SaveOrcamento";

export const ChangeQuantidade = (sku, quantidade, indexOrcamento) => {
  return (dispatch) => {
    dispatch(changeQuantidade(str, index, indexOrcamento));
    dispatch(saveOrcamento({ index: indexOrcamento }));
  };
};
